import React from "react";

const ErrorNotFound = () => {
  return (
    <>
      <div className="flex flex-column align-items-center justify-content-center text-center font-bold h-screen mx-auto">
        <p>404</p>
        <div>Not Found</div>
      </div>
    </>
  );
};

export default ErrorNotFound;
